import React from 'react';
import ReactDOM from 'react-dom';

function Card(){
  return(
    <>
<div className="cards">
  <div className="card">
    <img src="https://occ-0-2794-2219.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABWJ9gHTe7kitsMnKwP8hUGOINcBOMCMkYreYwYb5MGTIeIBiFAS8fJCMqUy6jmo1hfYCxHKJfDz0KOp042--im1qLun2.jpg?r=9ff" alt="mypic" className="card__img" />
    <div className="card__info">
      <span className="card__category"> A Netflix Original Series </span>
      <h3 className="card__title"> Breaking Bad </h3>
      <a href="https://www.netflix.com/search?q=breaking%20bad&jbv=70143836" target="_blank">
        <button> Watch Now </button>
      </a>
    </div>
  </div>

</div>
</>
  )
}

ReactDOM.render(
  <Card />,
document.getElementById('root')
);
